import * as React from "react";
import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";

const Sidebar = () => {
  const itemData = [
    {
      img: "images/banner-1.png",
      title: "Breakfast",
    },
    {
      img: "images/banner-2.png",
      title: "Breakfast",
    },
    {
      img: "images/banner-3.png",
      title: "Breakfast",
    },
    {
      img: "images/banner-4.png",
      title: "Breakfast",
    },
    {
      img: "images/banner-5.png",
      title: "Breakfast",
    },
    {
      img: "images/banner-6.png",
      title: "Breakfast",
    },
  ];

  return (
    <>
      <div className="banner-item">
        <a href="#">
          <img className="img-fluid" src="images/banner-1.png" />
        </a>
      </div>
      <div className="banner-item">
        <a href="#">
          <img className="img-fluid" src="images/banner-2.png" />
        </a>
      </div>
      <div className="banner-item">
        <a href="#">
          <img className="img-fluid" src="images/banner-3.png" />
        </a>
      </div>
      <div className="banner-item">
        <a href="#">
          <img className="img-fluid" src="images/banner-4.png" />
        </a>
      </div>
      <div className="banner-item">
        <a href="#">
          <img className="img-fluid" src="images/banner-5.png" />
        </a>
      </div>
      <div className="banner-item">
        <a href="#">
          <img className="img-fluid" src="images/banner-6.png" />
        </a>
      </div>
    </>
  );
};
export default Sidebar;
